If a majority of the valid ballots are cast for International Brotherhood of Electrical Workers Local Union 160, AFL-CIO, they will be taken to have indicated the employees’ desire to be included in the existing bargaining unit of employees currently represented by International Brotherhood of Electrical Workers Local Union 160, AFL-CIO, and covered by the Metro West Region Labor Agreement. If a majority of the valid ballots are not cast for representation, they will be taken to have indicated the employees’ desire to remain unrepresented.

